import { useSelector } from "react-redux"


export const SearchFilter = (searchdata) => {
    return (dispatch) => {
        const ValueStore = []
        for (let i in searchdata) {
            for (let n in searchdata[i]) {
                // for (let b in searchdata[i][n].name[1]) {
                // for (let b = 1; b >= searchdata.length; b++) {
                // if (event.current.value === searchdata[i][n].name[b]) {
                ValueStore.push(searchdata[i][n])
                // }
                // }
            }
        }
        dispatch({
            type: 'searchfilter',
            payload: ValueStore
        })
    }
}
export const SearchFilter2 = (data, event) => {
    return (dispatch) => {
        const ValueStore = []
        ValueStore.push(data.filter(product => product.name.toLowerCase().includes(event))
    )
        dispatch({
            type: 'onclick',
            payload: ValueStore
        })
    }
}
